import React from "react";
import BreakInterval from "../src/components/BreakInterval/BreakInterval";
import SessionInterval from "../src/components/SessionInterval/SessionInterval";

import "./App.css";

class App extends React.Component {
  constructor() {
    super();

    this.state = {
      breakLength: 10,
      sessionLength: 35,
      timerMinute: 35
    };
  }

  render() {
    return (
      <div className="App">
        <h2>Pomodoro Clock</h2>
        <BreakInterval breakLength={this.state.breakLength} />
        <SessionInterval sessionLength={this.state.sessionLength} />
      </div>
    );
  }
}

export default App;
